import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Home from 'pages/Home';
import Navbar from 'components/Navbar';
import Patologia from 'pages/Patologia';

const Routes = () => {
  return (
    <BrowserRouter>
      <Navbar />
      <Switch>
        <Route path="/" exact>
          <Home />
        </Route>
        <Route path="/patologias">
          <Patologia />
        </Route>
      </Switch>
    </BrowserRouter>
  );
};

export default Routes;
